import React, { useState, useEffect } from 'react'
import './Exercises.css'
// import Button from '@material-ui/core/Button';


function ShowExercises() {

  const [query, serQuery] = useState('');

  useEffect(async () => {
    try {
      const getExercises = await fetch(
        'http://getExercises:8080/api/v1/exercise'
      );
      const json = await getExercises.json();
      console.log({json});
    } catch (error) {}
  }, [query]);

  return (
    <div className='exercises'>
      <h1>Here you can see all exercises you did in the past</h1>
    </div>
  )
}

export default ShowExercises
